import React from "react";

function Navbar() {
  return (
    <nav className="bg-blue-700 shadow-md p-4 flex justify-center">
      <h1 className="text-white text-2xl font-bold hover:scale-105 transition-transform duration-300">
        IPO Web Application
      </h1>
    </nav>
  );
}

export default Navbar;
